import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

const Header = ({
  text
}) => < h1 id = "hi" > {
  text
} < /h1>;

const Element = < p > Параграф < /p>;

class Main extends React.Component {

  render() {
    console.log(1);
    return ( <
      div className = "main" >
      <
      Header text = {
        'свойство текст' + this.props.count
      }
      /> {
        Element
      }; <
      /div>
    )
  }
}

ReactDOM.render( <
  React.StrictMode >
  <
  Main count = {
    5
  }
  /> <
  /React.StrictMode>,
  document.getElementById('root')
);
